        public static readonly List<string> broomstickDescriptions = new List<string>()
        {
            "Гоночная метла, созданная Флайтом и Баркером в 1990 году. Позиционировала себя как основной конкурент «Нимбуса», способный вытеснить последнего с рынка. Обладала прекрасной отделкой и рядом дополнительных возможностей, таких как встроенный свисток и самораспрямляющиеся хвостовые прутья. Однако при полётах на больших высотах подвергалась сильной коррозии, отчего снискала репутацию метлы для волшебников, у которых галлеонов больше, чем мозгов.",
            "Гоночная метла фирмы «Чёрный лес». Выпущена в 1952 году на основе модели «Тайфун». Обладает серьёзным недостатком — теряет мощность при наборе высоты. Профессиональные игроки в квиддич предпочитают не пользоваться этой моделью.",
            "Метла для полётов, которую изобрёл и изготовил мастер-метельщик из Портсмута Элия Гримстоун. Эта метла была самой первой моделью изобретателя.",
            "Первая гоночная метла компании «Комета», была выпущена в 1929 году. Она была названа Кометой-140, потому что перед промышленным выпуском было протестировано 140 мётел. Это была первая метла, где были задействованы Тормозящие чары Хортона-Кейтча, которые значительно снижали риск промахнуться по воротам или вылететь за пределы поля при игре в квиддич. Она быстро стала выбором сборных Англии и Ирландии.",
            "Вторая модель гоночной метлы, выпущенная фирмой «Комета» на основе предыдущей модели «Комета-140». Являлась основным конкурентом мётел моделей «Чистомёт-2» и «Чистомёт-3».",
            "Метла компании «Комета». Упоминание о ней можно заметить в объявлениях о продаже, которое дал магазин подержанных мётел «Сплинтер и Крик» в «Ежедневном пророке».",
            "Метла, изготовленная фирмой «Комета». Вероятно, в своё время весьма неплохая метла, раз она оказалась в семействе Малфоев. На первом курсе Драко хвастался, что оставил «Комету-260» дома.",
            "Метла, изготовленная фирмой «Комета». Была выпущена в производство летом 1995. Разгоняется до 60 миль в час, но только с попутным ветром. Рон Уизли приводит показатели ускорения Кометы-290 по сравнению со своей новой метлой «Чистомёт-11», полученной от миссис Уизли перед пятым курсом в подарок за то, что сын был назначен старостой.",
            "Летающая метла, созданная Глэдис Бутби в 1901 году. Модель явилась большим шагом вперёд в конструировании мётел, и некоторое время мётлы «Лунный луч» с ясеневой ручкой пользовались большим спросом среди игроков в квиддич. Основным преимуществом «Лунного луча» над другими метлами была его способность подниматься намного выше, чем это удавалось раньше и сохранять управляемость на этих высотах.",
            "Марка спортивных летающих мётел. Её изобретатель — Рэндольф Спадмор. Выпуск «Молнии» пришёлся на 1993 год. Своё название получила из-за выдающихся скоростных характеристик.",
            "Спортивная метла серии «Молния» для профессиональных игроков в квиддич. Вероятно, выпущена незадолго до Чемпионата мира 2014 года и является последней и самой усовершенствованной метлой серии. На этих мётлах летали чемпионы Кубка мира 2014 года — Сборная Болгарии по квиддичу.",
            "Первая метла компании «Скоростные мётлы Нимбус», выпущенная в 1967 году. Развивала скорость до ста миль в час[1]. Могла поворачивать на 360 градусов в любой точке пространства. Сочетала в себе надёжность «Дубравы-79» и лёгкость в управлении «Чистомёта». Серия «Нимбус» стала любимой среди профессиональных квиддичных команд.",
            "Вторая метла компании «Скоростные мётлы Нимбус». Она помогла компании сохранить лидерство среди изготовителей мётел. Её скорость была увеличена на 6 миль в час (больше такого прироста в скорости нет ни у одной метлы серии «Нимбус» по сравнению с предыдущей моделью) и составила 106 миль в час[1].",
            "Третья метла компании «Скоростные мётлы Нимбус». Она помогла компании сохранить лидерство среди изготовителей мётел. Скорость полёта составила 107 миль в час[1].",
            "Четвёртая метла компании «Скоростные мётлы Нимбус». Она помогла компании сохранить лидерство среди изготовителей мётел. Скорость её была увеличена по сравнению с предыдущей моделью и составила 108 миль в час.",
            "Метла компании Скоростные мётлы Нимбус. Выпущена в августе 1991 года, и в то время была самой скоростной метлой в производстве. «Нимбус-2000» быстро обогнал своих конкурентов.",
            "Метла компании «Скоростные мётлы Нимбус». Была выпущена в августе 1992 года и на момент выпуска являлась флагманской моделью производителя. О более свежих моделях мётел этой компании нет никаких сведений. Использовалась большинством команд по квиддичу по всему миру, несмотря на то, что выпущенная в следующем году «Молния» обладала ещё более выдающимися характеристиками и стоила несомненно намного дороже: стоимость одной «Молнии» могла равняться семи «Нимбусам-2001», а ведь и он стоит весьма прилично.",
            "Модель метлы для полётов, созданная мастером Леонардо Джуксом. Является прообразом гоночной метлы. Развивала намного большую скорость, чем её предшественники «Лунный луч» и «Дубрава-79» — до 70 миль в час при попутном ветре.",
            "Метла для семейного использования. Описывается как «безопасная» и «надёжная». Поставляется с встроенной противоугонной сигнализацией. «Синяя муха» была разрекламирована на рекламной доске на финале мирового кубка по Квиддичу в 1994 году.",
            "Гоночная метла производства фирмы «Чёрный лес», основанной Эллерби и Спадмором. Выпущена в 1940 году. Отличалась неплохими ходовыми качествами, но уступала в скорости метлам модели «Чистомёт» и «Комета». Продолжением серии стала метла модели «Вихрь».",
            "Гоночная метла фирмы «Universal Brooms Ltd», выпущенная в 1955 году. На момент выпуска являлась самой дешёвой моделью. После первой вспышки покупательского спроса выяснилось, что метла после длительного использования начинает терять высоту и скорость. В 1978 году фирма прекратила свою деятельность.",
            "Это — первая скоростная метла, разработанная специально для использования в спорте. Была выпущена в огромном количестве, что не характерно для мётел того времени. Отличалась повышенной манёвренностью и имела огромный успех. Через год после её выпуска (в 1927) многие британские команды по квиддичу отдавали предпочтение именно этой метле.",
            "Продолжение успешной Чистомёт-1. Метла была произведена фирмой «Чистомёт». Конкурировала с метлой «Комета-180». Продолжением серии стала метла Чистомёт-3.",
            "Продолжение линии мётел Чистомёт-1 и Чистомёт-2. Создана фирмой «Чистомёт» в 1937 году. Основным конкурентом на рынке была метла модели «Комета-180».",
            "Метла фирмы «Чистомёт».",
            "Портивная мётла фирмы «Чистомёт». По-видимому, «Чистомёт-5» — очень старая метла, если учесть что её предшественница (Чистомёт-4) была выпущена аж в 1946 году.",
            "В одном из номеров журнала «Придира» от 1995 года было опубликовано интервью с волшебником, утверждавшим, что долетел на этой метле до Луны и набрал в доказательство мешок лунных лягушек. Учитывая репутацию издания, этот факт может быть подвергнут сомнению. Данное интервью попалось на глаза Гарри Поттеру, когда он пролистывал журнал «Придира» в Хогвартс-экспрессе в сентябре 1995 года.",
            "Метла, созданная фирмой «Чистомёт». По характеристикам близка к Нимбус-2000. В 1991 году капитан команды Гриффиндора по квиддичу Оливер Вуд посоветовал Гарри Поттеру купить эту метлу.",
